import itertools; import math; import operator; import random; from bisect import *; from collections import deque, defaultdict, Counter, OrderedDict; from functools import reduce; from heapq import *; import unittest; from typing import List;
def get_sol(): return Solution()
class Solution:
    def smallestDistancePair(self, nums: List[int], k: int) -> int:
        def has_at_least_k_pair_with_at_most_d_difference(d):
            res=0
            i,j=0,1
            while i<len(nums):
                while j<len(nums) and (nums[j]-nums[i])<=d:
                    j+=1
                res+=j-i-1 # '-1' because it calculates no of pair
                i+=1
            return res>=k

        nums.sort()
        lo,hi=0,nums[-1]-nums[0]
        while lo<=hi:
            mid=(lo+hi)//2
            if has_at_least_k_pair_with_at_most_d_difference(mid):
                hi=mid-1
            else:
                lo=mid+1
        return lo

class Solution2:
    def smallestDistancePair(self, nums: List[int], k: int) -> int:
        n=len(nums)
        nums.sort()
        mnHeap=[]
        for i in range(n):
            j=i+1
            if j<n:
                diff=nums[j]-nums[i]
                heappush(mnHeap,[diff,i,j])

        diff=None
        while k:
            diff,i,j=heappop(mnHeap)
            j+=1
            if j<n:
                newDiff=nums[j]-nums[i]
                heappush(mnHeap,[newDiff,i,j])
            k-=1
        return diff

